import Product from "./Product";
function Home() {
  return (
    <div className="home">
      <div className="home__container">
        <img className="home__image" src={require("./image/base1.jpg")} alt="unable to load image" />



        <div className="home__row">
         <Product title ="ankur warikoo"
             price ={299}
